import React from "react";
import { AppBar, Toolbar, Typography, Fab } from "@material-ui/core";
import { Compare } from "@material-ui/icons";

export default () => {
  return (
    <AppBar>
      <Toolbar>
        <Typography variant="headline" color="inherit">
          Disc Golf Disc Search Tool
          <Fab>
            <Compare />
          </Fab>
        </Typography>
      </Toolbar>
    </AppBar>
  );
};
